import { Switch, Route, BrowserRouter } from 'react-router-dom'
import Repositories from './Repositories';

const Routes = () => {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/repositories" component={Repositories}/>
        <Route path="/" component={Home}/>
      </Switch>
    </BrowserRouter>

  )
}

export default Routes
